          "id": "3feea4b442a647e9fb0c80a4d225a66ef3a00554",
          "message": "chore: make variables a private member of the builder (#14456)\n\nMakes `variables` a private member of the builder and fixes improper\nusage in a handful of places. This prevents usage like\n`builder.variables[input_x.index] = g1.x;` which is not the correct way\nto set the underlying witness value of `input_x` since its actual value\ndepends on `builder->real_variable_idx[input_x.index]`.\n\nAdds builder method `set_variable(idx, value)` intended to replace\nusages of `builder.assert_equal(builder.add_variable(value), idx)`. Both\nhave the same effect on the final circuit but the latter has the benefit\nof not adding an unnecessary entry to `variables`. This should allow the\ncircuit hash to agree between the circuit constructed with a dummy\nwitness vs a real one.",
          "timestamp": "2025-05-23T22:04:55Z",
