          "id": "82ae6da93f6cf4a886551d3b89e9c0e55f680404",
          "message": "chore: introduce message processing (#14567)\n\nThis creates a new `message::processing` module in aztec-nr, for us to\nplace components related to the message processing pipeline, e.g.\nfetching of logs, processing of notes, etc. We need such a concept in\norder to properly handle batched network requests, backups, etc.\n\nThis just lays the groundwork by moving some things around, hiding the\ncomplexity of log discovery into a `get_private_logs` function. This\nwill be later be expanded upon by also including a capsule array for\nnotes to be added to pxe, etc.\n\n---------\n\nCo-authored-by: Jan Bene <janbenes1234@gmail.com>",
