          "id": "139f14dcf037422f5fab7dff0c62ee66590d743a",
          "message": "feat: `PublicImmutable` initialization optimization (#14608)\n\nUpon `PublicImmutable` initialization we wrote a value to a designated\ninitialization slot in public storage that later on was used to\ndetermine if the value is already initialized or not. In this PR I\nreplace the public write with emission of a nullifier which yields the\nfollowing savings:\n1. Lowered DA cost by 1 field as emitting a nullifier consumes 1 field\nbut writing to public storage 2 (1 extra field for the tree index),\n2. cheaper reads as it's cheaper to verify nullifier inclusion compared\nwith public tree value check as nullifier tree is much smaller (hence we\nneed less hashing to perform the merkle proof) - note that this applies\nonly to `read` method as `read_unsafe` method doesn't perform\ninitialization check.\n\n---------\n\nCo-authored-by: Nicols Venturo <nicolas.venturo@gmail.com>",
